import { useEffect, useState } from "react";
import M from "materialize-css";
const AdminList=()=>{
   const [data,setData]=useState([])
   useEffect(()=>{
    fetch("/admin/viewAdmins")
    .then(res=>res.json())
    .then(result=>{
        console.log(result)
       if(result.error){
          M.toast({html: result.error,classes:"#c62828 red darken-3"})
       }
       else{
            // console.log(result)
             setData(result.admins)
       }
    }).catch(err=>{
        console.log(err)
    })
   },[])
    return(
       
                <table>
                <thead>
                <tr>
                    <th>Id</th>
                    <th>First Name</th>
                    <th>Last Nmae</th>
                    <th></th>
                </tr>
                </thead>

                <tbody>
                    
                        {
                            data.map(item=>{
                                return(
                                    <tr>
                                        <td>{item.id}</td>
                                        <td>{item.firstName}</td>
                                        <td>{item.lastName}</td>
                                        <td>view</td>
                                    </tr>
                                )
                            })
                        }
                </tbody>
            </table>

       
          
          
      
      
    )
}

export default AdminList;
